import React from "react";
import { Link } from "react-router-dom";
import "./Home.css";

function Home() {
  return (
    <div className="home-page" style={{ backgroundImage: `url('/assets/hero-bg.jpg')` }}>
      <div className="overlay">
        <h1>Find Your Dream Job</h1>
        <p>Your career journey starts here. Join and explore opportunities.</p>
        <Link to="/login" className="btn-primary">Get Started</Link>
      </div>
    </div>
  );
}

export default Home;
